import React, { Component }  from 'react';
import { Button } from './Button';

export class Form extends Component {

  render() {
    return (
      <div>
        <button type="button" onClick={this.props.clearList}>
          Clear
        </button>
        <form>
          <h4>Add new vehicles</h4>
          <label>Name:</label>
          <input type="text" placeholder="name" name="name" onChange={this.props.onChangeInput} />
          <label>Model:</label>
          <input type="text" placeholder="model" name="model" onChange={this.props.onChangeInput} />
          <Button labelBtn="Add Item" handleBtn={this.props.addItem} />
        </form>
      </div>
    )
  }
}
